### 2.3.2 Backward Process (Denoising)

If we reverse a diffusion process in time, then under some mild conditions (see, for example, Cattiaux et al. (2022); Föllmer (1985)) which are satisfied for all processes under consideration in this work, we still get a diffusion process. To be more precise, we want to have a process $\tilde{X}$ such that for $t \in[0, T], \tilde{X}(t)=X(T-t)$. From the Fokker-Planck equation and the log trick (Anderson, 1982), the corresponding reverse process for Process (1) is

$$
\begin{aligned}
& d \tilde{X}(t)=g^{2}(T-t) \nabla \log p_{T-t}(\tilde{X}(t)) d t \\
& -f(T-t, \tilde{X}(t)) d t+g(T-t) d W(t), \tilde{X}(0) \sim p_{T}
\end{aligned}
$$

where $\nabla$ represents taking derivative with respect to the space variable $x$. We call the term $\nabla \log p_{t}(x)$ as the (Stein) score function. If the forward process is an OU process, then the reverse process is $\tilde{X}(0) \sim p_{T}$ and $d \tilde{X}(t)=\left(a \tilde{X}(t)+\sigma^{2} \nabla \log p_{T-t}(\tilde{X}(t))\right) d t+\sigma d W(t)$.

If the backward SDE can be simulated (which is typically done via Euler-Maruyama method, see details in Supplementary Material Section A.2), we can generate samples from the distribution $p_{0}$. We can view simulating the backward SDE as the denoising step from pure noise to the groundtruth distribution.

## G.2.1 Sampling from KL-Divergence Barycenter

Because the StableDiffusionXLPipeline class in Hugging Face's Diffusers library does not natively support the ensembling of two U-Nets denoisers during inference, we adapted their source code so that it can ensemble the log-probability gradient tensors for a specified set of barycenter weights. The new pipeline class can be inspected in src/SDXL_inference.py in our Github repository. As mentioned in the previous subsection, the two auxiliary models share the exact same VAE and text encoder. Therefore, the only component of the generation pipeline that we combine at inference time is the U-Net's outputs.

Our hyperparameter setting follows the default values of a general Diffusers inference pipeline; checkpoints are loaded at fp16 precision, CFG guidance scale is 5.0 , guidance rescale is zeroed, latent noise has shape $4 \times 128 \times 128$, and the final tensor output has shape $4 \times 1024 \times 1024$. The number of denoising steps is set to 100 , and the timesteps are given by the default discrete Euler scheduler. We used the same text prompts across all generations: \{'Positive Prompt': "a photo of a mathematics scientist, looking at the camera, ultra quality, sharp focus", 'Negative Prompt': "cartoon, anime, 3d, painting, b@w, low quality."\}
